oxy_webhelp_navlinks = {"cover_sync-d895e933":{"topics":[{"title":"Zotero同步介绍","shortdesc":"<p class=\"shortdesc\">Zotero默认将所有数据存储在本地计算机。但您可于登录后利用 Zotero 的同步功能在任何可上网的计算机访问 Zotero 库。Zotero         同步分为两类：数据同步（Data Syncing）和文件同步（File Syncing）。<\/p>","href":"7文件同步与备份\/同步\/Syncing_introduction.html","attributes":{"data-id":"concept_zmy_yh5_ldc"},"menu":{"hasChildren":false},"tocID":"concept_zmy_yh5_ldc-d895e941","topics":[]},{"title":"7.2.1 数据同步设置","shortdesc":"<p class=\"shortdesc\">数据同步可将您储存在本地的文库分类、条目信息、注释、笔记等上传至 Zotero 服务器（除附件外），您可以在任何安装 Zotero 的计算机上使用该数据，并在         zotero.org 上在线查看图书馆。数据同步免费且不受限，您可以在不同步文件的情况下使用。<\/p>","href":"7文件同步与备份\/同步\/Data_syncing.html","attributes":{"data-id":"Data_syncing"},"menu":{"hasChildren":false},"tocID":"Data_syncing-d895e952","topics":[]},{"title":"7.2.2 文件同步设置","shortdesc":"<p class=\"shortdesc\">文件同步指同步Zotero中的附件，如pdf文件、caj文件。因数据同步并不同步附加的文件，要同步这些文件，您可使用Zotero         Storage或WebDAV以进行文件同步的设置，对数据同步进行补充。<\/p>","href":"7文件同步与备份\/同步\/File_syncing.html","attributes":{"data-id":"File_syncing"},"menu":{"hasChildren":false},"tocID":"File_syncing-d895e963","next":"File_syncing-d895e963"},{"title":"同步过程中的授权问题及应对方式","href":"7文件同步与备份\/同步\/Syncing_failure%20and%20solution_authorization.html","attributes":{"data-id":"trouble_srg_fcd_mdc"},"menu":{"hasChildren":false},"tocID":"trouble_srg_fcd_mdc-d895e1007","topics":[]},{"title":"同步过程中的网络连接问题及应对方式","href":"7文件同步与备份\/同步\/Syncing_failure%20and%20solution_network.html","attributes":{"data-id":"trouble_srg_fcd_mdc"},"menu":{"hasChildren":false},"tocID":"trouble_srg_fcd_mdc-d895e1015","topics":[]}]}};